  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for J. Clark
  Salyer Wetland Management District outlines Refuge accomplishments during the 1982
  calendar year. The report begins with a summary of the year's highlights and weather
  conditions. Land acquisition is covered. The report includes a planning section
  which discusses management planning and public participation. Refuge administration
  is outlined; information about personnel, funding, and safety is given. Habitat
  management is also covered; subjects include wetlands, forests, croplands, grasslands,
  grazing, haying, fire management, pest control, water rights, wilderness areas,
  and WPA easements. The wildlife section of the report discusses waterfowl, marsh
  birds and waterbirds, shorebirds, raptors, game mammals, and wildlife propagation.
  The public uses of the Refuge described in this report include hunting, trapping,
  and law enforcement. The equipment and facilities section of the report provides
  information about equipment replacement. Cooperative programs are provided at the
  end.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
